import React, { useState } from 'react';
import './Register.css';
import username_icon from '../Assets/username.png';
import email_icon from '../Assets/email.png';
import password_icon from '../Assets/password.png';
import axios from 'axios';
import { useHistory } from 'react-router-dom';

const Register = () => {
    const [username, setUsername] = useState('');
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');
    const history = useHistory();

    const handleRegister = async (e) => {
        e.preventDefault();
        try {
            await axios.post('http://localhost:5000/register', { Username: username, Email: email, Password: password });
            history.push('/');
        } catch (error) {
            console.error(error);
        }
    };

    return (
        <div className='container'>
            <div className="header">
                <div className="text">Register</div>
                <div className="underline"></div>
            </div>
            <form className="inputs" onSubmit={handleRegister}>
                <div className="input">
                    <img src={username_icon} alt="Username" />
                    <input type="text" value={username} onChange={(e) => setUsername(e.target.value)} placeholder='Name' required />
                </div>
                <div className="input">
                    <img src={email_icon} alt="Email" />
                    <input type="email" value={email} onChange={(e) => setEmail(e.target.value)} placeholder='Email' required />
                </div>
                <div className="input">
                    <img src={password_icon} alt="Password" />
                    <input type="password" value={password} onChange={(e) => setPassword(e.target.value)} placeholder='Password' required />
                </div>
                <div className="submit-container">
                    <button type="submit" className="submit">Register</button>
                </div>
            </form>
        </div>
    );
};

export default Register;
